import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import TextField from '@material-ui/core/TextField';
import Typography from '@material-ui/core/Typography';
import MenuItem from '@material-ui/core/MenuItem';
import Icon from '@material-ui/core/Icon';
import Input from '@material-ui/core/Input';
import InputLabel from '@material-ui/core/InputLabel';
import InputAdornment from '@material-ui/core/InputAdornment';
import FormControl from '@material-ui/core/FormControl'; 

/* import Grid from '@material-ui/core/Grid'; */
/* import AccountCircle from '@material-ui/icons/AccountCircle'; */

const useStyles = makeStyles((theme) => ({
  root: {
    '& > *': {
      margin: theme.spacing(1),
      width: '50ch',
    },
  },
  margin: {
    margin: theme.spacing(1),
  },
}));

export default function BasicTextFields() {
  const classes = useStyles();

  const currencies = [
    {
      value: 'USD',
      label: '$',
    },
  ];

  return (
    
    <form className={classes.root} noValidate autoComplete="off">
      
      <Typography variant="subtitle1" color="inherit" className="mt-8 sm:mt-16 mx-auto max-w-512">
          Ingresa los datos de cada Estudiante
			</Typography>
        <TextField
          id="standard-select-currency"
          select
          label="Tipo de Documento"
        >
          {currencies.map((option) => (
            <MenuItem key={option.value} value={option.value}>
              {option.label}
            </MenuItem>
          ))}
      </TextField>
      <FormControl fullWidth className={classes.margin}>
        <InputLabel htmlFor="standard-adornment-amount">NÃºmero de Documento*</InputLabel>
        <Input
          id="standard-adornment-amount"
          startAdornment={<InputAdornment position="start">
            <Icon className="text-20" color="action">
              blur_circular
								</Icon>
          </InputAdornment>}
        />
      </FormControl>
      <FormControl fullWidth className={classes.margin}>
        <InputLabel htmlFor="standard-adornment-amount">Nombres*</InputLabel>
        <Input
          id="standard-adornment-amount"
          startAdornment={<InputAdornment position="start">  <Icon className="text-20" color="action">
            person
								</Icon></InputAdornment>}
        />
      </FormControl>
      <FormControl fullWidth className={classes.margin}>
        <InputLabel htmlFor="standard-adornment-amount">Apellidos*</InputLabel>
        <Input
          id="standard-adornment-amount"
          startAdornment={<InputAdornment position="start">  <Icon className="text-20" color="action">
            person_add
								</Icon></InputAdornment>}
        />
      </FormControl>
      <FormControl fullWidth className={classes.margin}>
        <InputLabel htmlFor="standard-adornment-amount">Telefono</InputLabel>
        <Input
          id="standard-adornment-amount"
          startAdornment={<InputAdornment position="start">  <Icon className="text-20" color="action">
            phone
								</Icon></InputAdornment>}
        />
      </FormControl>
      <FormControl fullWidth className={classes.margin}>
        <InputLabel htmlFor="standard-adornment-amount">Correo Electronico</InputLabel>
        <Input
          id="standard-adornment-amount"
          startAdornment={<InputAdornment position="start">  <Icon className="text-20" color="action">
            alternate_email
								</Icon></InputAdornment>}
        />
      </FormControl>


        {/*  <TextField id="standard-basic" label="Standard" />
        <TextField id="standard-basic" label="Standard" /> */}
       
    </form>
  );
}
